import React from 'react';
import "./modal.css"


export const Modal = ({active, setActive}) => {



  return (
	  <div className={active ? "modal active" : "modal"} onClick={()=>setActive(false)}>
		  <div className={active ? "modal active" : "modal"} onClick={e=>e.stopPropagation()}>

		  </div>
	  </div>
  );
};
